import { Navbar } from "./shared/component/Navbar";
import React, { useState } from "react";
import "./App.css";

function App() {
  const [count] = useState<number>(0);

  return (
    <main>
      <Navbar count={count} />
      <article>
        <h1>Home</h1>
        <div className="card">
          <h2>Title</h2>
          <p>Body</p>
        </div>
      </article>
    </main>
  );
}

export default App;
